import React from "react";
import '../asset/CSS/Main.css';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import Home from "../components/Home";
import Login from "../components/Login";

export default function Router_App() {
  return (
    <Router>
        <Switch>
        <Route path="/Login">
            <Login />
          </Route>
          <Route path="/Login">
            <Login />
          </Route>
          <Route path="/">GioHang
            <Home />
          </Route>
        </Switch>
      
    </Router>
  );
}
